import React from 'react';
import {
  Box, Typography, Table, TableBody, TableCell, TableContainer,
  TableHead, TableRow, Paper, TextField
} from '@mui/material';

const FormComponent2 = ({ title, subjectsData, idLabel = 'Roll Number' }) => {
  const [name, setName] = React.useState('');
  const [idValue, setIdValue] = React.useState(''); // Single dynamic identifier
  const [dob, setDob] = React.useState('');
  const [subjects, setSubjects] = React.useState(subjectsData);

  const handleMarksChange = (index, value) => {
    const updated = [...subjects];
    const numericValue = Number(value);
    updated[index].secured = value;

    if (value === '') {
      updated[index].result = '';
    } else {
      updated[index].result =
        numericValue >= updated[index].minMarks ? 'PASS' : 'FAIL';
    }

    setSubjects(updated);
  };

  const totalMaxMarks = subjects.reduce((sum, s) => sum + s.maxMarks, 0);
  const totalMinMarks = subjects.reduce((sum, s) => sum + s.minMarks, 0);
  const totalSecuredMarks = subjects.reduce((sum, s) => {
    const secured = Number(s.secured);
    return sum + (isNaN(secured) ? 0 : secured);
  }, 0);

  return (
    <Box sx={{ p: 3, maxWidth: 800, margin: '0 auto' }}>
      <Typography variant="h6" gutterBottom>{title}</Typography>

      <TextField
        label="Name"
        fullWidth
        margin="normal"
        value={name}
        onChange={(e) => setName(e.target.value)}
      />

      <TextField
        label={idLabel}
        fullWidth
        margin="normal"
        value={idValue}
        onChange={(e) => setIdValue(e.target.value)}
      />

      <TextField
        label="Date of Birth"
        type="date"
        fullWidth
        margin="normal"
        InputLabelProps={{ shrink: true }}
        value={dob}
        onChange={(e) => setDob(e.target.value)}
      />

      <TableContainer component={Paper} sx={{ mt: 3 }}>
        <Table>
          <TableHead>
            <TableRow sx={{ backgroundColor: '#f5f5f5' }}>
              <TableCell>Subject</TableCell>
              <TableCell align="right">Max Marks</TableCell>
              <TableCell align="right">Min Marks</TableCell>
              <TableCell align="right">Marks Secured</TableCell>
              <TableCell>Result</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {subjects.map((subject, index) => (
              <TableRow key={index}>
                <TableCell>{subject.name}</TableCell>
                <TableCell align="right">{subject.maxMarks}</TableCell>
                <TableCell align="right">{subject.minMarks}</TableCell>
                <TableCell align="right">
                  <TextField
                    type="number"
                    size="small"
                    value={subject.secured}
                    onChange={(e) => handleMarksChange(index, e.target.value)}
                    sx={{ width: 80 }}
                    inputProps={{ max: subject.maxMarks, min: 0 }}
                  />
                </TableCell>
                <TableCell>{subject.result}</TableCell>
              </TableRow>
            ))}
            <TableRow sx={{ backgroundColor: '' }}>
              <TableCell><strong>Grand Total</strong></TableCell>
              <TableCell align="right"><strong>{totalMaxMarks}</strong></TableCell>
              <TableCell align="right"><strong>{totalMinMarks}</strong></TableCell>
              <TableCell align="right"><strong>{totalSecuredMarks}</strong></TableCell>
              <TableCell />
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default FormComponent2;
